import React, { useState, useEffect } from "react";
import { DataGrid } from "@material-ui/data-grid";
import Button from "@material-ui/core/Button";
import DeleteIcon from "@material-ui/icons/Delete";
import { makeStyles } from "@material-ui/core/styles";
import axios from "axios";
import { useHistory } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { checklogin, signout } from "../../actions/userActions";

const useStyles = makeStyles((theme) => ({
  button: {
    margin: theme.spacing(1),
  },
}));

export default function TableUserAdmin({ columns }) {
  const [selectionModel, setselectionModel] = useState();
  const userCheckLogin = useSelector((state) => state.userCheckLogin);
  const { loadingCheckLogin, successCheckLogin, errorCheckLogin } =
    userCheckLogin;
  const [rows, setRows] = useState([]);
  const history = useHistory();
  const classes = useStyles();
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(checklogin());
    if (errorCheckLogin) {
      dispatch(signout());
      history.push("/signin");
    }
  }, [userCheckLogin]);
  return (
    <>
      <div style={{ height: 400, width: "100%" }}>
        <DataGrid
          rows={rows}
          columns={columns}
          pageSize={5}
          checkboxSelection
          onSelectionModelChange={(newSelection) => {
            setselectionModel(newSelection.selectionModel);
          }}
          selectionModel={selectionModel}
        />
      </div>
      <div className="list_btn">
        <Button
          variant="contained"
          color="secondary"
          className={classes.button}
          startIcon={<DeleteIcon />}
        />
      </div>
    </>
  );
}
